import PropTypes from 'prop-types';
import { Table } from "./Transaction.styled";
import { TransactionItem } from './TransactionItem';

export function Transaction({ items }) {
    return (
        <Table>
              <thead>
        <tr>
          <th>Type</th>
          <th>Amount</th>
          <th>Currency</th>
        </tr>
      </thead>

      <tbody>
        {items.map(({ id, type, amount, currency }) => {
          return (
            <TransactionItem
              key={id}
              type={type}
              amount={amount}
              currency={currency}
            />
          );
        })}
      </tbody>
        </Table>
    )
}
